script: |
  super -f text -I q3910.spq | sort > q3910.out

inputs:
  - name: q3910.spq
    data: |
      SELECT DISTINCT - + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 * + col0 NOT IN ( col2, - 37 + + col2, col0 * - CAST ( - col1 AS INTEGER ) * - col2 );
  - name: tab2

outputs:
  - name: q3910.out
    data: |
